import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="home-container">
      <section className="intro">
        <h1>Welcome to the CPP Coding Club</h1>
        <p>
          Join us to improve your coding skills by solving competitive programming problems.
        </p>
        <Link to="/contests">See Current Contests</Link>
      </section>
    </div>
  );
};

export default Home;
